import React from "react"
import { Typography } from "@material-ui/core"
import Card  from "../../../components/card/card"
import { Grid } from "@material-ui/core";

export default function LivePlay(props){
    const one = "Level One: Perception";
    const two = "Level Two: Connection";
    const three = "Level Three: Reflection";

    return (
        <Grid container xs={12} sm={12} md={12} lg={12}>
            <Grid item xs={2} sm={2} md={2} lg={2}></Grid>
            <Grid item xs={8} sm={8} md={8} lg={8} alignContent="center">
                <Typography variant="h5">Card 1/15</Typography>
                <Card title={one} question="If I throw it back, can you handle that? Discuss." brand="Strangers or Not" />
            </Grid>
            <Grid item xs={2} sm={2} md={2} lg={2}></Grid>
        </Grid>
    )
}
